import React from "react";

const About = () => {
  return (
    <div className="aboutBG">
      <div className="aboutText">
        <h2>A little about me</h2>
        <div>
          <p>
            Bacon ipsum dolor amet boudin tongue frankfurter ground round jerky
            shoulder beef cow prosciutto sausage. Hamburger ground round pork
            belly, sausage swine chuck beef meatloaf salami bacon brisket
            biltong landjaeger shoulder bresaola. Picanha tenderloin cow
            leberkas. Pork belly cow short loin shank, wine chislic jerky
            tenderloin kielbasa. Flank hamburger strip steak rump.
          </p>
        </div>
      </div>
    </div>
  );
};

export default About;
